Use cob_conta
go

declare @w_empresa	int,
		@w_oficina	int,
		@w_area_con	int
		
if exists (select 1 from cob_conta..sysobjects where name = 'cb_plan_general')
begin
	select @w_empresa = pa_tinyint from cobis..cl_parametro where pa_nemonico = 'EMP' and pa_producto = 'ADM'
	select @w_area_con = pa_smallint from cobis..cl_parametro where pa_nemonico = 'ACA' and pa_producto = 'AHO'
	select @w_oficina = pa_smallint from cobis..cl_parametro where pa_nemonico = 'OMAT' and pa_producto = 'AHO'
	select @w_oficina = 7020
	
	delete from cob_conta..cb_plan_general where pg_empresa = @w_empresa and pg_oficina = @w_oficina and pg_area = @w_area_con

	
	select pg_empresa, pg_cuenta, of_oficina, pg_area, pg_clave
		from cob_conta..cb_plan_general, cobis..cl_oficina
		where of_oficina not in (@w_oficina)
end
else
	print 'NO EXISTE TABLA cb_plan_general'
go
